<script>
    // Armazena os dados da loja selecionada
    let lojaAtual = null;

    function buscar() {
        const java = document.getElementById('javaInput').value.trim();
        const dadosRaw = document.getElementById('dadosLojas').textContent.split('\n');
        
        lojaAtual = null;
        for (let linha of dadosRaw) {

        } else {
